import React, {Component} from 'react';
import fetch from 'isomorphic-unfetch'
import Layout from '../components/Layout'
import Repos from '../components/Repos'

class Software extends Component {
  constructor() {
    super();
    this.state = {
      repos: []
    }
  }

  static async getInitialProps() {
    const res = await fetch('https://api.github.com/users/alexdo21/repos')
    console.log("something")
    const repos = await res.json();
    console.log(`show data fetched. Count: ${repos.length}`)
    return {repos}
  }

  componentWillMount() {
    this.setState({repos: this.props.repos})
  }

  render() {
    return (
      <Layout>

        <div className="landing">
          <div className="centerLanding">
            <h1>Software</h1>
            <ul>

            </ul>
          </div>
        </div>


        <style jsx>{`
          .landing {
            height: 100vh;
            position: relative;
          }

          .centerLanding {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translateX(-50%) translateY(-50%);
          }
         `}</style>
      </Layout> 
    );
  }
}

Software.getInitialProps = async function() {
  const res = await fetch("https://api.github.com/users/alexdo21/repos")
  const data = await res.json()
  return {
    id: data.id,
    name: data.name,
    link: data.html_url,
    des: data.description
  }
}

export default Software;
